# Rime dictionary
# encoding: utf-8
#小鹤双拼的单字词库，同时利用小鹤纯双拼规则匹配［八股文］来实现单字
#2020年09月05日修订 为避免一码单字干扰组词，将一码单字全部修改为二码；不删除二码单字主要是为了避免常用单字的缺失。
---
name: double_pinyin_xnhedn # 詞典名，內部使用，命名原則同「方案標識」；可以與配套的輸入方案標識一致，也可不同；
version: "2020.05.24" #管理詞典的版本，規則同輸入方案定義文件的版本號；
sort: original # 詞條初始排序方式，可選填 by_weight（按詞頻高低排序）或 original（保持原碼表中的順序）；
use_preset_vocabulary: false #填 true 或 false，選擇是否導入預設詞彙表【八股文】。
# sort: by_weight
# use_preset_vocabulary: false/true

import_tables:
  - double_pinyin_xnhedn.xdhycycb #现代汉语常用词表 建议开启
  - luna_pinyin # 这个是默认使用的明月拼音，用于输入规则正则转换全码后匹配［八股文］的单字；在本方案中必须开启
  - double_pinyin_xnhedn.sys #这个是小鹤双拼输入法的符号词库，建议开启
  #- double_pinyin_xnhedn.myself #个人补充自用词汇
  #- double_pinyin_xnhedn.WGroup #
  #- luna_pinyin.emoji
  #- luna_pinyin.emoji.cldr
  #- luna_pinyin.emoji.scomper
  #- luna_pinyin.emoji.apple

